import React, { Fragment, useState } from "react";
import './addMember.css';
import Navbar from "../components/navbar";
import notiIcon from '../images/icons8-notifications-64.png';
import settingsIcon from '../images/icons8-settings-50.png';
import menuIcon from '../images/icons8-menu-50.png';
import axios from "axios";
import { API_ROUTES } from "../app-modules/api_routes";

const AddMember = () => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const [formData, setFormData] = useState({
        user_honorific: '',
        user_first_name: '',
        user_middle_name: '',
        user_last_name: '',
        user_email: '',
        user_phone: '',
        user_med_council_number: '',
        user_category: '',
        user_type: '',
        user_package_id: '',
        user_city: '',
        user_state_of_practice: ''
    });
    const [error, setError] = useState('');

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        if (!formData.user_category) {
            setError('Please select a category.');
            return;
        }
        // Send form data to server
        axios.post(API_ROUTES.addMember, formData)
            .then(response => {
                console.log('Member added successfully:', response.data);
                // Reset form data after successful submission
                setFormData({
                    user_honorific: '',
                    user_first_name: '',
                    user_middle_name: '',
                    user_last_name: '',
                    user_email: '',
                    user_phone: '',
                    user_med_council_number: '',
                    user_category: '',
                    user_type: '',
                    user_package_id: '',
                    user_city: '',
                    user_state_of_practice: ''
                });
                setError('');
            })
            .catch(error => {
                console.error('Error adding member:', error);
            });
    };



    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
    };

    return (
        <Fragment>
            <div className="div_main_dashboard">
                <div className="dashboard_header_container">
                    <header className="dashboard_header">
                        <div className="header_left">
                            <img src={menuIcon} alt="Menu" className="menu-icon" onClick={toggleMenu} />
                            <h1>Add member</h1>
                        </div>
                    </header>
                </div>
                <Navbar isMenuOpen={isMenuOpen} toggleMenu={toggleMenu} />
                <div>
                <div className="form-container">
            <h2>Add Member</h2>
            <form onSubmit={handleSubmit}>
                <label>
                    Email:
                    <input type="email" name="email" value={formData.email} onChange={handleChange} required />
                </label>
                <label>
                    Honorific:
                    <select name="honorific" value={formData.honorific} onChange={handleChange} required>
                        <option value="">Select</option>
                        <option value="Dr">Dr</option>
                        <option value="Mr">Mr</option>
                        <option value="Ms">Ms</option>
                        <option value="Mrs">Mrs</option>
                    </select>
                </label>
                <label>
                    First Name:
                    <input type="text" name="firstName" value={formData.firstName} onChange={handleChange} required />
                </label>
                <label>
                    Middle Name:
                    <input type="text" name="middleName" value={formData.middleName} onChange={handleChange} />
                </label>
                <label>
                    Last Name:
                    <input type="text" name="lastName" value={formData.lastName} onChange={handleChange} required />
                </label>
                <label>
                    Phone Number:
                    <input type="text" name="phoneNumber" value={formData.phoneNumber} onChange={handleChange} required />
                </label>
                <label>
                    Address:
                    <input type="text" name="address" value={formData.address} onChange={handleChange} />
                </label>
                <label>
                    City:
                    <input type="text" name="city" value={formData.city} onChange={handleChange} />
                </label>
                <label>
                    State:
                    <input type="text" name="state" value={formData.state} onChange={handleChange} />
                </label>
                <label>
                    Medical Council Number:
                    <input type="text" name="medicalCouncilNumber" value={formData.medicalCouncilNumber} onChange={handleChange} />
                </label>
                <label>
                    Category:
                    <select name="category" value={formData.category} onChange={handleChange} required>
                        <option value="">Select</option>
                        <option value="Delegate">Delegate</option>
                        <option value="Faculty">Faculty</option>
                    </select>
                </label>
                <label>
                    Visitor Type:
                    <select name="visitorType" value={formData.visitorType} onChange={handleChange} required>
                        <option value="">Select</option>
                        <option value="Clinician">Clinician</option>
                        <option value="Embryologist">Embryologist</option>
                        <option value="Other">Other</option>
                    </select>
                </label>
                <label>
                    Package ID:
                    <select name="packageId" value={formData.packageId} onChange={handleChange} required>
                        <option value="">Select</option>
                        <option value="1">NR1-1</option>
                        <option value="2">NR1-2</option>
                        <option value="3">SO1-1</option>
                        <option value="4">SO1-2</option>
                        <option value="5">DO1-1</option>
                        <option value="6">DO1-2</option>
                    </select>
                </label>
                <button type="submit">Submit</button>
            </form>
        </div>
                </div>
            </div>
        </Fragment>
    );
}

export default AddMember;
